import React from 'react';
import bannerBackground from "./assets/images/bannerBackground.png"
const Banner = () => {
    return (
        <div className="container">
            <div className="banner">
                <img src={bannerBackground} alt=""/>
            </div>
        </div>
    );
};

export default Banner;
